import React from 'react';
import Box from '../Box';

export default function Whats(){
    return(
        <div id='conte'>
        <div className='Whats'>
            <Box titulo='Victor Santos' informacao='Hey there, Im using WhatsApp' butao="enviar" imag='imagens/whatsApplogo.png'/>
        </div>
        </div>
    )
}
